i: lb://cognition-auth\n          predicates:\n            - Path=/auth/**\n          filters:\n            # 验证码处理\n            - ValidateCodeGatewayFilter\n            # 前端密码解密\n            - PasswordDecoderFilter\n        #UPMS 模块\n        - id: cognition-upms-biz\n          uri: lb://cognition-upms-biz\n          predicates:\n            - Path=/admin/**\n          filters:\n            # 限流配置\n            - name: RequestRateLimiter\n              args:\n                key-resolver: \'#{@remoteAddrKeyResolver}\'\n                redis-rate-limiter.replenishRate: 100\n                redis-rate-limiter.burstCapacity: 200\n        # 代码生成模块\n        - id: cognition-codegen\n          uri: lb://cognition-codegen\n          predicates:\n            - Path=/gen/**\n        # 线上康复训练模块\n        - id: cognition-train-biz\n          uri: lb://cognition-train-biz\n          predicates:\n            - Path=/cognition/**\n         # 快筛模块\n        - id: cognition-screening-biz\n          uri: lb://cognition-screening-biz\n          predicates:\n            - Path=/screening/**\n         # 心理量表模块\n        - id: cognition-mind-biz\n          uri: lb://cognition-mind-biz\n          predicates:\n            - Path=/mind/**    \n        # Demo模块\n        - id: ct-demo-biz\n          uri: lb://ct-demo-biz\n          predicates:\n            - Path=/ct/**\n        #第三方用户 模块\n        - id: cognition-otheru-biz\n          uri: lb://cognition-otheru-biz\n          predicates:\n            - Path=/otheru/**\n          filters:\n            # 限流配置\n            - name: RequestRateLimiter\n              args:\n                key-resolver: \'#{@remoteAddrKeyResolver}\'\n                redis-rate-limiter.replenishRate: 100\n                redis-rate-limiter.burstCapacity: 200\n        #第三方用户 模块\n        - id: cognition-sort-biz\n          uri: lb://cognition-sort-biz\n          predicates:\n            - Path=/sort/**\n          filters:\n            # 限流配置\n            - name: RequestRateLimiter\n              args:\n                key-resolver: \'#{@remoteAddrKeyResolver}\'\n                redis-rate-limiter.replenishRate: 100\n                redis-rate-limiter.burstCapacity: 200\n        #京师服务\n        - id: cognition-js-biz\n          uri: lb://cognition-js-biz\n          predicates:\n            - Path=/js/**\n          filters:\n            # 限流配置\n            - name: RequestRateLimiter\n              args:\n                key-resolver: \'#{@remoteAddrKeyResolver}\'\n                redis-rate-limiter.replenishRate: 100\n                redis-rate-limiter.burstCapacity: 200\n        #训练仪对接服务\n        - id: cognition-device-biz\n          uri: lb://cognition-device-biz\n          predicates:\n            - Path=/device/**\n          filters:\n            # 限流配置\n            - name: RequestRateLimiter\n              args:\n                key-resolver: \'#{@remoteAddrKeyResolver}\'\n                redis-rate-limiter.replenishRate: 100\n                redis-rate-limiter.burstCapacity: 200\n        #眼动视频解析服务\n        - id: cognition-eyetrack-biz\n          uri: lb://cognition-eyetrack-biz\n          predicates:\n            - Path=/eyetrack/**\n          filters:\n            # 限流配置\n            - name: RequestRateLimiter\n              args:\n                key-resolver: \'#{@remoteAddrKeyResolver}\'\n                redis-rate-limiter.replenishRate: 100\n                redis-rate-limiter.burstCapacity: 200\n        #消息同步服务\n        - id: cognition-sync-biz\n          uri: lb://cognition-sync-biz\n          predicates:\n            - Path=/sync/**\n          filters:\n            # 限流配置\n            - name: RequestRateLimiter\n              args:\n                key-resolver: \'#{@remoteAddrKeyResolver}\'\n                redis-rate-limiter.replenishRate: 100\n                redis-rate-limiter.burstCapacity: 200       \ngateway:\n  encode-key: \'thanks,pig4cloud\'\n  ignore-clients:\n    - test\n    - demo\n    \n\nswagger:\n  ignore-p