 # jackson配置如果为null 不会显示在返回参数中\n  jackson:\n    default-property-inclusion: non_null\n  codec:\n    max-in-memory-size: 10MB\nlogging:\n  openlog: true\n  level:\n    com.hj.base.admin.api.feign: debug\n    com.hj.ct.api.train.feign: debug\n    com.hj: debug\n\n# 暴露监控端点\nmanagement:\n  endpoints:\n    web:\n      exposure:\n        include: \'*\'\n\n# feign 配置\nfeign:\n  sentinel:\n    enabled: true\n  okhttp:\n    enabled: true\n  httpclient:\n    enabled: false\n    #可以配置okhttp 连接池的最大空闲连接数 默认200个\n    maxConnections: 100\n    #可以配置okhttp 连接池的保持时间 单位秒  默认900\n    timeToLive: 90\n  client:\n    config:\n      default:\n        connectTimeout: 30000\n        readTimeout: 30000\n        loggerLevel: BASIC\n\n  compression:\n    request:\n      enabled: false\n    response:\n      enabled: false\n\n# mybaits-plus配置\nmybatis-plus:\n  mapper-locations: classpath:/mapper/*Mapper.xml\n  global-config:\n    banner: false\n    db-config:\n      id-type: assign_id\n      table-underline: true\n      logic-delete-value: 1\n      logic-not-delete-value: 0\n  configuration:\n    map-underscore-to-camel-case: true\n\n\n# spring security 配置\nsecurity:\n  oauth2:\n    resource:\n      loadBalanced: true\n      token-info-uri: http://cognition-auth/oauth/check_token\n    # 通用放行URL，服务个性化，请在对应配置文件覆盖\n    ignore:\n      urls:\n        - /v2/api-docs\n        - /actuator/**\n# swagger 配置\nswagger:\n  title: 和家训练API\n  license: Powered By hj\n  licenseUrl: https://hj.com\n  terms-of-service-url: https://hj.com\n  host: https://rzcs.yj-health.com/dev/api\n  contact:\n    email: hj@gmail.com\n    url: https://hj.com\n  authorization:\n    name: hj OAuth\n    auth-regex: ^.*$\n    authorization-scope-list:\n      - scope: server\n        description: server all\n    token-url-list:\n      - http://${GATEWAY_HOST:cognition-gateway}:${GATEWAY-PORT:9999}/auth/oauth/token\nknife4j:\n  enable: true\n\ncognition:\n  enableLocalAuth: true\n  localCacheTime: 600\n  #给手机验证码登录用\n  defaultOrgId: 100\n